SELECT COALESCE("USERDISPLAYNAME", "USERDISPLAYNAME") AS "USERDISPLAYNAME", "POSTTITLE", "POSTCREATIONDATE", "POSTSCORE", "COMMENTCOUNT", "UPVOTECOUNT", "DOWNVOTECOUNT", "TAGS", "Score", "CreationDate"
FROM (SELECT ANY_VALUE("DisplayName") AS "USERDISPLAYNAME", ANY_VALUE("Title") AS "POSTTITLE", ANY_VALUE("CreationDate0") AS "POSTCREATIONDATE", ANY_VALUE("Score") AS "POSTSCORE", COUNT("Id1") AS "COMMENTCOUNT", SUM("FD_COL_5") AS "UPVOTECOUNT", SUM("FD_COL_6") AS "DOWNVOTECOUNT", LISTAGG("TagName", "FD_COL_8") AS "TAGS", "Score", "CreationDate0" AS "CreationDate"
FROM "s1"
GROUP BY "DisplayName", "Title", "CreationDate0", "Score"
ORDER BY "Score" DESC NULLS FIRST, "CreationDate0" DESC NULLS FIRST) AS "t6"